  responsible for maintaining the boundary between the United States and Canada.  This
  shapefile is the most accurate representation of the boundary to date.\",\n\t\"license_title\":
  \"License Not Specified\",\n\t\"extras\": [],\n\t\"organization\": {\n\t\t\"description\":
  \"The Commission is made up of two commissioners; one appointed in the United States
  and one in Canada, each chief of his own staff, equipment and budget. The U.S. Commissioner
  is appointed by the President and reports to the Secretary of State. The Canadian
  Commissioner is appointed by Order-in-Council, and reports to the Minister for Foreign
  Affairs. For administrative purposes, the Canadian Section of the Boundary Commission
  is located within the Department of Natural Resources Canada as a section of the
